// https://on.cypress.io/blob
cy.get('.utility-blob').then(function ($div) {
    // https://github.com/nolanlawson/blob-util#imgSrcToDataURL
    // get the dataUrl string for the javascript-logo
    return Cypress.Blob.imgSrcToDataURL('https://example.cypress.io/assets/img/javascript-logo.png', undefined, 'anonymous')
        .then(function (dataUrl) {
        // create an <img> element and set its src to the dataUrl
        var img = Cypress.$('<img />', { src: dataUrl });
        // need to explicitly return cy here since we are initially returning
        // the Cypress.Blob.imgSrcToDataURL promise to our test
        // append the image
        $div.append(img);
        cy.get('.utility-blob img').click()
            .should('have.attr', 'src', dataUrl);
    });
});

// https://on.cypress.io/minimatch
var matching = Cypress.minimatch('/users/1/comments', '/users/*/comments', {
    matchBase: true
});
expect(matching, 'matching wildcard').to.be["true"];
matching = Cypress.minimatch('/users/1/comments/2', '/users/*/comments', {
    matchBase: true
});
expect(matching, 'comments').to.be["false"];
// ** matches against all downstream path segments
matching = Cypress.minimatch('/foo/bar/baz/123/quux?a=b&c=2', '/foo/**', {
    matchBase: true
});
expect(matching, 'comments').to.be["true"];
// whereas * matches only the next path segment
matching = Cypress.minimatch('/foo/bar/baz/123/quux?a=b&c=2', '/foo/*', {
    matchBase: false
});
expect(matching, 'comments').to.be["false"];

// https://on.cypress.io/moment
var time = Cypress.moment('2014-04-25T19:38:53.196Z').utc().format('h:mm A');
expect(time).to.be.a('string');
cy.get('.utility-moment').contains('3:38 PM')
    .should('have.class', 'badge');
// the time in the element should be between 3pm and 5pm
var start = Cypress.moment('3:00 PM', 'LT');
var end = Cypress.moment('5:00 PM', 'LT');
cy.get('.utility-moment .badge')
    .should(function ($el) {
    // parse American time like "3:38 PM"
    var m = Cypress.moment($el.text().trim(), 'LT');
    // display hours + minutes + AM|PM
    var f = 'h:mm A';
    expect(m.isBetween(start, end), m.format(f) + " should be between " + start.format(f) + " and " + end.format(f)).to.be["true"];
});

// https://on.cypress.io/promise
var waited = false;
/**
 * @return Bluebird<string>
 */
function waitOneSecond() {
    // return a promise that resolves after 1 second
    // @ts-ignore TS2351 (new Cypress.Promise)
    return new Cypress.Promise(function (resolve, reject) {
        setTimeout(function () {
            // set waited to true
            waited = true;
            // resolve with 'foo' string
            resolve('foo');
        }, 1000);
    });
}
cy.then(function () {
    // return a promise to cy.then() that
    // is awaited until it resolves
    // @ts-ignore TS7006
    return waitOneSecond().then(function (str) {
        expect(str).to.eq('foo');
        expect(waited).to.be["true"];
    });
});
